export default {
  props: {
    to: {
      type: String
    },
    title: {
      type: String
    }
  },
  data: function data() {
    return {
      titles: this.title
    };
  },
  methods: {
    goBack: function goBack() {
      var _this = this;

      if (this.to) {
        var opendList = this.$store.state.admin.page.opened;
        var openData = opendList.filter(function (item) {
          console.log(item.fullPath.indexOf(_this.to));
          return item.fullPath.split('?')[0] === _this.to;
        });

        if (openData.length === 0) {
          this.$router.go(-1);
        } else {
          this.$router.push({
            path: this.to || '/',
            query: openData[0].query,
            params: openData[0].params
          });
        }
      } else {
        this.$router.go(-1);
      }
    }
  }
};
